The American singer is famous for her fantastic voice. She can sing impressive high notes, but is she a soprano?&nbsp;
Kelly Clarkson is a soprano. Her vocal range fits well within the standard range for classical soprano singers.
Kelly’s Vocal Range Fits a Soprano Kelly’s vocal range, or where she is comfortable singing, matches with the range of a soprano. A soprano is the highest vocal range category, so this means Kelly can sing higher notes than most people.
